#Get all oxides (highest oxidation state) associated with constituent element

def data(AorB):
    data0 = mpr.query(criteria={"elements": {"$all": [AorB, "O"]},'nelements':2},
                      properties=['material_id'])
    return data0




def oxstate(item):
    cf = mpr.query(item['material_id'],['pretty_formula'] )
    cff = ((mpr.query(cf[0]['pretty_formula'],['unit_cell_formula']))[0])['unit_cell_formula']
    pMc = int(list(cff.values())[0])
    pOc = int(list(cff.values())[1])

    PMc = pMc/gcd(pMc,pOc)
    POc = pOc/gcd(pMc,pOc)

    oxstate = POc*2/PMc
    return oxstate
    
def theo(data):
    oxstates = []
    dataa = []
    for item in data:
        theoo =  mpr.query(str(item['material_id']),['theoretical']) 
        if theoo[0]['theoretical'] == False:
            oxstates.append(oxstate(item))
            dataa.append(item)
    return oxstates, dataa
#print( list(theo(data))[0] )
            


def highstates(oxstates):
    ox = list(set(oxstates))
    ox = sorted(ox,reverse = True)
    oxstatess = []

    if len(ox) >= 2: 
        oxstatess.append(ox[0])
        oxstatess.append(ox[1])
    

    else:
        oxstatess = ox
    return oxstatess
    
    


# In[32]:


def oxide1(AorB):
    
    oxides1 = []
    oxides2 = []
    
    dat = list(theo(data(AorB)))
    
    if len(dat) == 0:
        pass
    
    dataa = dat[1]
    oxstates = dat[0]
    oxstatess = highstates(oxstates)
    
    for item in dataa:
        if oxstates[dataa.index(item)] == oxstatess[0]:
            oxides1.append(item)
        elif oxstates[dataa.index(item)] == oxstatess[1]:
            oxides2.append(item)
            
    return oxides1, oxides2
 
    


